DROP TABLE IF EXISTS reviews;
CREATE TABLE reviews(
   id                 INTEGER  NOT NULL PRIMARY KEY 
  ,gas_station_id     INTEGER  NOT NULL REFERENCES gas_stations(id)
  ,rating             NUMERIC(2,1)
